import React from "react"

function ProductsBlock({name, ckal, proteins, fats, carbohydrates}) {
  return (
      <div className="item-card">
        <h4 className="products-block__title">{name}</h4>
        <span>{ckal}</span>
        <span>{proteins}</span>
        <span>{fats}</span>
        <span>{carbohydrates}</span>
    </div>
  )
}

export default ProductsBlock
